export default function Square({value}) {
  return <div style={styles.square}>{value}</div>;
}

const styles = {
    square: {
        width: "100px",
        height: "100px",
        backgroundColor: "lightgray",
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
    }
}
